import Layout from "../components/Layout"
import Head from "next/head"

export default function Staff(){
  return (
    <Layout style={{ textAlign: 'center'}}>

      <Head>
        <title>Bread - Our Staff</title>
      </Head>

      <h2>Our Awesome Staff</h2>
    </Layout>
  )
}
